import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Login.css';

function Login() {
  const navigate = useNavigate();
  const [credentials] = useState({
    email: 'isabel@whispering.ai',
    password: '•••••••'
  });

  const handleSignIn = (e) => {
    e.preventDefault();
    // For demo purposes, just navigate to home
    navigate('/home');
  };

  return (
    <div className="login-page">
      <div className="login-container">
        <h1>Welcome to Dobson Ranch</h1>
        
        <div className="logo-container">
          <img 
            src="/images/dobson-logo.png" 
            alt="Dobson Ranch Logo" 
            className="logo"
          />
        </div>

        <p className="login-description">
          Sign In or Sign Up to make reservations, place orders, and try our virtual caddy!
        </p>

        <div className="auth-buttons">
          <button className="auth-btn sign-in-btn">Sign In</button>
          <button className="auth-btn sign-up-btn">Sign Up</button>
        </div>

        <form onSubmit={handleSignIn} className="login-form">
          <input
            type="email"
            value={credentials.email}
            readOnly
            className="login-input"
          />
          <input
            type="password"
            value={credentials.password}
            readOnly
            className="login-input"
          />
          <button type="submit" className="submit-btn">
            Sign In
          </button>
        </form>

        <div className="divider">
          <span>or</span>
        </div>

        <button className="google-btn">
          Continue with Google
        </button>
      </div>
    </div>
  );
}

export default Login;
